    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 60 NOT BETWEEN + - CAST ( - col2 AS INTEGER ) - - - col2 AND ( - CAST ( 61 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q6096.out
    data: |
